var svg = d3.select("#map")
	.attr("width", MAP_WIDTH)
	.attr("height", MAP_HEIGHT);

//--- map ---//
var container = svg.append("g")
		.attr("id", "map-handle")
		.call(zoom);

// to enable drag on all positions add rect in background with background color
container.append("rect")
	.attr("x", -MAP_WIDTH)
	.attr("y", -MAP_HEIGHT)
	.attr("width", 2*MAP_WIDTH)
	.attr("height", 2*MAP_HEIGHT)
	.style("fill", "#082935");
	// .style("fill", "#222");

var infoText = svg.append("g")
	.attr("id", "info-text");

infoText.append("text")
	.attr("x", 50)
	.attr("y", 50)
	.text("");
infoText.append("rect")
	.attr("x", -50)
	.attr("y", 52)
	.attr("height", 1)
	.style("fill", "#BEF");	

var countries = container.selectAll(".country")
		.data(data)
	.enter().append("g")
		.attr("class", "country")
		.on("click", countryClickedOn)
		.on("mouseover", countryHover)
		.on("mouseout", countryOut);

countries.append("path")
	.attr("d", function(d) { return d.path; });
countries.append("text")
	.attr("name", function(d) { return d.name; });

//--- chart ---//
var CHART_WIDTH = MAP_WIDTH/4,
	CHAR_HEIGHT = MAP_HEIGHT/4;

var chart = svg.append("g")
	.attr("id", "chart-handle")
	.attr("transform", "translate(0," + MAP_HEIGHT + ")");

// var chartTitle = chart.append("text")
// 	.attr("y", "1.2em")
// 	.attr("dx", ("test title").length/2 + "em")
// 	.text("test title");

var pieChart = chart.append("g")
	.attr("class", "pieChart")
	.attr("transform", "translate(0,0)")
	.append("rect")
		.attr("y", CHAR_HEIGHT)
		.attr("width", CHART_WIDTH)
		.attr("height", CHAR_HEIGHT)
		.style("fill", "steelblue")
		.on("click", countryClickedOff);


//--- functions ---//
//--- navigation functions ---//
function zoomed() {
	countries.select("path").style("stroke-width", countries.style("stroke-width")/2);

	container.transition()
		.duration(500)
		.attr("transform", "translate(" + d3.event.translate + ")scale(" + d3.event.scale + ")");
}

//--- country functions ---//
function countryHover() {
	var countryPath = d3.select(this).select("path");
	var countryText = d3.select(this).select("text");
	
	// map changes
	infoText.select("text").text(countryText.attr("name"));
	infoText.select("rect").transition()
		.delay(200)
		.duration(500)
		.attr("width", 128+countryText.attr("name").length*7);
	infoText.transition()
	  	.duration(200)
	 	.style("fill-opacity", 1)
	  	.attr("transform", "translate(" + 50 + ",0)");	

	countryPath.transition()
		.duration(500)
		.style("fill", "steelblue")
		.style("stroke-width","0");
}

function countryOut() {
	var countryPath = d3.select(this).select("path");
	var countryText = d3.select(this).select("text");

	infoText.select("rect").transition()
		.delay(1500)
		.duration(1500)
		.attr("width", 0);
	infoText.transition()
	  	.duration(1500)
	 	.style("fill-opacity", 0)
	  	.attr("transform", "translate(" + -200 + ",0)");	

	countryPath.transition()
		.duration(500)
		.style("fill", "#ddd")
		.style("stroke-width","1");
}

function countryClickedOn() {
	// map shift
	var country = d3.select(this);

	countries.on("click", 0)
		.on("mouseover", 0)
		.on("mouseout", 0);

	country.attr("class", "selectedCountry")
		.style("fill", "steelblue");

	countries = d3.selectAll(".country")

	countries.transition()
		.duration(500)
		.style("fill-opacity", 0)
		.style("stroke-opacity", 0);

	country.attr("class", "country");

	// induces bad behaviour
	// container.transition()
	// 	.duration(500)
	// 	.attr("transform", "translate(0,0)scale(1,1)");
	container.transition()
		.delay(600)
		.duration(2000)
		.attr("transform", "translate(0," + -MAP_HEIGHT + ")");
	chart.transition()
		.delay(600)
		.duration(2000)
		.attr("transform", "translate(0,0)");

	country.select("path").transition()
		.delay(2000)
		.style("fill", "#ddd");

	// title
	infoText.transition()
		.delay(800)
		.duration(1000)
		.attr("transform", "translate(" + MAP_WIDTH/2 + ",0)");
	infoText.select("text").transition()
		.duration(1000)
		.attr("x", -infoText.select("text").text().length/4 + "em")
		.style("fill", "#FFF");
	infoText.select("rect").transition()
		.delay(800)
		.duration(1000)
		// .ease("elastic")
		.attr("x", -infoText.select("text").text().length*0.6 + "em")
		.attr("width", infoText.select("text").text().length*1.2 + "em")
		.attr("height", 4)
		.attr("rx", 1)
		.attr("ry", 1)
		.style("fill", "#FFF");;
}

function countryClickedOff() {
	// map shift
	container.transition()
		.delay(500)
		.duration(2000)
		.attr("transform", "translate(0,0)");
	chart.transition()
		.delay(500)
		.duration(2000)
		.attr("transform", "translate(0," + MAP_HEIGHT + ")");

	countries = d3.selectAll(".country")
	countries.on("click", countryClickedOn)
		.on("mouseover", countryHover)
		.on("mouseout", countryOut);
	countries.transition()
		.delay(2400)
		.duration(500)
		.style("fill-opacity", 1)
		.style("stroke-opacity", 1);

	// title
	infoText.transition()
		.delay(800)
		.duration(1000)
		.attr("transform", "translate(" + 50 + ",0)");
	infoText.select("text").transition()
		.delay(800)
		.duration(1500)
		.attr("x", 50)
		.attr("y", 50)
		.style("fill", "#BEF");
	infoText.select("rect").transition()
		.delay(800)
		.duration(1500)
		.attr("x", -50)
		.attr("width", 128+infoText.select("text").text().length*7)
		.attr("height", 1)
		.attr("rx", 0)
		.attr("ry", 0)
		.style("fill", "#BEF");;
}